    of expenses for this committee in Nevada is Presidential Only Election Year 28%
    fixed allocation ratio.    This report amends the allocation items impacted by
    this global error. In this original report, the amount transferred from the non-federal
    to the allocation account was $2,702.69. The amount that should have been transferred
    based on this amended report is $2,335.24.    The committee will correct this
