    on October 15, 2007.    This correction will also modify the ending cash totals
    that will be carried forward to the reports for the remainder of the year.          Schedule
    H2 has been corrected to display only the fundraising allocation ratios that correspond
    to actual fundraising disbursements during the reporting period.    In March 2007
    the Committee converted to an outside vendor for assistance in preparing reports
